  const foodsList = props.foodsList;

  function addCartClickHandler(e) {
    console.log(e.target);
  }

  return (
    <div>
      {foodsList.map((food: Items): ReactElement => {
        const name = food.name;
        return <div key={name} onClick={addCartClickHandler}>{name}</div>
      })}
    </div>
  )
}
